                                <h1 style="text-align: justify;"><a id="1. Giới thiệu chung"
                                                                    name="1. Giới thiệu chung"><strong><span
                                                style="font-size:20px;"><span
                                                    style="line-height:2;">1. Giới thiệu chung</span></span></strong></a>
                                </h1>

                                <p style="text-align: justify;"><span style="line-height:2;">Công ty cổ phần Early Start là đơn vị cung cấp, chủ sở hữu của các ứng dụng giáo dục cho trẻ: E&K nhận biết được tầm quan trọng của dữ liệu cá nhân mà khách hàng đã tin tưởng cung cấp cho chúng tôi và tin rằng chúng tôi có trách nhiệm quản lý, bảo vệ và xử lý dữ liệu cá nhân của khách hàng một cách thích hợp theo các quy định về bảo vệ bí mật thông tin cá nhân của pháp luật Việt Nam (“Luật riêng tư”). Chúng tôi xây dựng Chính sách bảo mật này nhằm giúp khách hàng hiểu về những nguyên tắc khi tiếp cận, sử dụng, và/hoặc xử lý dữ liệu cá nhân mà khách hàng đã cung cấp cho chúng tôi tại website E&K.edu.vn và/hoặc trong quá trình đăng ký, sử dụng sản phẩm.</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">Bằng việc trao cho chúng tôi thông tin cá nhân của bạn, bạn đồng ý thông tin cá nhân của bạn sẽ được thu thập, sử dụng như được nêu trong Chính sách này. Nếu bạn không đồng ý với Chính sách này, bạn vui lòng không cung cấp cho chúng tôi bất cứ thông tin cá nhân nào và/hoặc sử dụng các quyền như được nêu tại mục 6 của chính sách này.</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">Chúng tôi khuyến khích khách hàng thường xuyên xem lại Chính sách bảo mật thông tin cá nhân này để có được những cập nhật mới nhất đảm bảo khách hàng biết và thực hiện quyền quản lý thông tin cá nhân của khách hàng.</span>
                                </p>

                                <h1 style="text-align: justify;"><a id="2. Những dữ liệu cá nhân nào được thu thập?"
                                                                    name="2. Những dữ liệu cá nhân nào được thu thập?"><strong><span
                                                style="font-size:20px;"><span style="line-height:2;">2. Những dữ liệu cá nhân nào được thu thập?</span></span></strong></a>
                                </h1>

                                <p style="text-align: justify;"><span style="line-height:2;">Dữ liệu cá nhân cung cấp trên website E&K.edu.vn và khi sử dụng các ứng dụng mà chúng tôi có thể thu thập bao gồm, nhưng không giới hạn:</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Họ và tên</span></p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Email</span></p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Số điện thoại</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Địa chỉ</span></p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Ngoài ra còn có thể là Facebook cá nhân</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">Khách hàng sẽ tự chịu trách nhiệm về tính chính xác và trung thực của các thông tin khi cung cấp cho chúng tôi. Ngoài ra, khách hàng có trách nhiệm thông báo kịp thời cho chúng tôi về những hành vi sử dụng trái phép, lạm dụng, vi phạm bảo mật để có biện pháp giải quyết phù hợp.</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">Khi khách hàng đăng ký khóa học, khách hàng sẽ được thêm vào danh sách nhận tin tức, đề xuất đặc biệt hoặc ưu đãi không thường xuyên từ chúng tôi.</span>
                                </p>

                                <h1 style="text-align: justify;"><a
                                        id="3. Những dữ liệu cá nhân được thu thập khi nào?"
                                        name="3. Những dữ liệu cá nhân được thu thập khi nào?"><span
                                            style="font-size:20px;"><strong><span style="line-height:2;">3. Những dữ liệu cá nhân được thu thập khi nào?</span></strong></span></a>
                                </h1>

                                <p style="text-align: justify;"><span style="line-height:2;">Chúng tôi sẽ/có thể thu thập dữ liệu cá nhân về khách hàng khi:</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Đăng nhập để học thử miễn phí hoặc sử dụng các nội dung đã mua trong ứng dụng bằng một trong các thông tin SĐT, Gmail hoặc Facebook;</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Đăng ký nhận tư vấn về các sản phẩm của công ty;</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Mua và thanh toán các sản phẩm của công ty.</span>
                                </p>

                                <h1 style="text-align: justify;"><a id="4. Mục đích và phạm vi sử dụng thông tin"
                                                                    name="4. Mục đích và phạm vi sử dụng thông tin"><strong><span
                                                style="font-size:20px;"><span style="line-height:2;">4. Mục đích và phạm vi sử dụng thông tin</span></span></strong></a>
                                </h1>

                                <p style="text-align: justify;"><span style="line-height:2;">Chúng tôi có thể thu thập, sử dụng, cung cấp và/hoặc xử lý dữ liệu cá nhân của khách hàng vì một hoặc nhiều mục đích sau đây:</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Liên hệ xác nhận khi khách hàng đăng ký sử dụng dịch vụ nhằm đảm bảo quyền lợi cho cho người tiêu dùng;</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Tạo Tài khoản người dùng (Account) đăng nhập vào các chương trình của chúng tôi (để học thử hoặc sử dụng các nội dung đã mua);</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Quản lý việc đăng nhập và sử dụng chương trình của chúng tôi trên các thiết bị khác nhau;</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Quản lý và đồng bộ tiến trình học trên mỗi ứng dụng theo tài khoản người dùng (Account);</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Tư vấn cho khách hàng qua điện thoại miễn phí về dịch vụ liên quan tới chương trình học ngôn ngữ - áp dụng phương pháp giáo dục sớm cho trẻ em;</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Giải đáp thắc mắc khách hàng;</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Gửi các thông báo về các hoạt động trao đổi thông tin giữa khách hàng và chúng tôi;</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Thực hiện các bản khảo sát khách hàng;</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Thực hiện các hoạt động quảng bá liên quan đến các khóa học;</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Ngăn ngừa các hoạt động phá hủy thông tin của khách hàng hoặc các hoạt động giả mạo khách hàng;</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Liên lạc và giải quyết với khách hàng trong những trường hợp đặc biệt;</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Trong trường hợp có yêu cầu của pháp luật: chúng tôi có trách nhiệm hợp tác cung cấp thông tin cá nhân khách hàng khi có yêu cầu từ cơ quan tư pháp bao gồm: Viện kiểm sát, tòa án, cơ quan công an điều tra liên quan đến hành vi vi phạm pháp luật nào đó của khách hàng. Ngoài ra, không ai có quyền xâm phạm vào thông tin cá nhân của khách hàng.</span>
                                </p>

                                <h1 style="text-align: justify;"><a id="5. Thời gian lưu trữ thông tin"
                                                                    name="5. Thời gian lưu trữ thông tin"><span
                                            style="font-size:20px;"><strong><span style="line-height:2;">5. Thời gian lưu trữ thông tin</span></strong></span></a>
                                </h1>

                                <p style="text-align: justify;"><span style="line-height:2;">Dữ liệu cá nhân của khách hàng sẽ được lưu trữ cho đến khi chúng tôi nhận được yêu cầu hủy bỏ, xóa. Còn lại trong mọi trường hợp thông tin cá nhân của khách hàng sẽ được bảo mật trên máy chủ của chúng tôi.</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">Chúng tôi sẽ lưu giữ và sử dụng thông tin của khách hàng khi cần tuân theo nghĩa vụ pháp lý, giải quyết tranh chấp và thực thi các thoả thuận của chúng tôi.</span>
                                </p>

                                <h1 style="text-align: justify;"><a
                                        id="6. Phương tiện và công cụ để người dùng tiếp cận và chỉnh sửa dữ liệu cá nhân của mình"
                                        name="6. Phương tiện và công cụ để người dùng tiếp cận và chỉnh sửa dữ liệu cá nhân của mình"><span
                                            style="font-size:20px;"><strong><span style="line-height:2;">6. Phương tiện và công cụ để người dùng tiếp cận và chỉnh sửa dữ liệu cá nhân của mình</span></strong></span></a>
                                </h1>

                                <p style="text-align: justify;"><span style="line-height:2;">- Khách hàng có quyền yêu cầu hủy bỏ, xóa thông tin cá nhân của mình bằng cách yêu cầu ban quản trị website E&K.edu.vn thực hiện việc này</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Khách hàng có quyền gửi khiếu nại về việc lộ thông tin cá nhân cho bên thứ 3 đến Ban quản trị của website E&K.edu.vn. Khi tiếp nhận những phản hồi này, chúng tôi sẽ xác nhận lại thông tin, phải có trách nhiệm trả lời lý do và thông báo cho khách hàng cách bảo mật lại thông tin.</span>
                                </p>

                                <h1 style="text-align: justify;"><a
                                        id="7. Cam kết bảo mật thông tin cá nhân khách hàng"
                                        name="7. Cam kết bảo mật thông tin cá nhân khách hàng"><strong><span
                                                style="font-size:20px;"><span style="line-height:2;">7. Cam kết bảo mật thông tin cá nhân khách hàng</span></span></strong></a>
                                </h1>

                                <p style="text-align: justify;"><span style="line-height:2;">- Thông tin cá nhân của khách hàng đã được thu thập được chúng tôi cam kết bảo mật tuyệt đối theo chính sách bảo vệ thông tin cá nhân chúng tôi đã ban hành. Việc thu thập và sử dụng thông tin của mỗi khách hàng chỉ được thực hiện khi có sự đồng ý của khách hàng đó trừ những trường hợp pháp luật có quy định khác.</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Không sử dụng, không chuyển giao, cung cấp hay tiết lộ cho bên thứ 3 nào về thông tin cá nhân của khách hàng khi không có sự cho phép đồng ý từ khách hàng hoặc có yêu cầu của cơ quan chức năng có thẩm quyền để phục vụ công tác điều tra, xét xử…</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Nếu chúng tôi tham gia vào sát nhập hoặc được mua lại một phần hay toàn bộ tài sản, khách hàng sẽ được thông báo qua email hoặc qua tin tức chính thức trên trang web của E&K.edu.vn về bất kì sự thay đổi quyền sở hữu hoặc sử dụng thông tin cá nhân của khách hàng, cũng như bất kỳ quyền của khách hàng nào liên quan đến thông tin cá nhân của khách hàng, tới bất kì bên thứ 3 nào với sự đồng ý của khách hàng.</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Trong trường hợp máy chủ lưu trữ thông tin bị hacker tấn công dẫn đến mất mát dữ liệu cá nhân khách hàng, website E&K.edu.vn sẽ có trách nhiệm thông báo vụ việc cho cơ quan chức năng điều tra xử lý kịp thời và thông báo cho khách hàng được biết.</span>
                                </p>

                                <p style="text-align: justify;"><span style="line-height:2;">- Bảo mật tuyệt đối mọi thông tin giao dịch trực tuyến của khách hàng bao gồm thông tin hóa đơn kế toán chứng từ số hóa tại khu vực dữ liệu trung tâm an toàn cấp 1 của E&K.edu.vn.</span>
                                </p>

