                <script>
                    var listProduct = {
                        2: 'com.earlystart.ltr.1year',
                        40: 'com.earlystart.stories.1year',
                        50: 'com.earlystart.math.1year',
                        51: 'com.earlystart.stories.vn.1year',
                    };
                    registrationAdvisory = async (e, type = 1) => {
                        e.stopPropagation();
                        e.preventDefault();

                        let name = $('#sign_up_for_advice_name_' + type).val().trim();
                        let phone = $('#sign_up_for_advice_phone_' + type).val().trim();
                        let email = $('#sign_up_for_advice_email_' + type).val().trim();
                        const nameItiSelectedDialCode = document.getElementById('sign_up_for_advice_phone_' + type).parentElement.children[0].children[0];
                        const valueCode = nameItiSelectedDialCode.children[1].innerHTML.replace(/[`~!@#$%^&*()_|+\-=?;:'",.<>\{\}\[\]\\\/]/gi, '');

                        let appId = document.getElementById('support-content-' + type).getAttribute('key');
                        appId = parseInt(appId);
                        let resultName = validateName(name, "val-name-" + type);
                        let resultEmail = validateEmail(email, "val-email-" + type);
                        let resultPhone = validatePhone(phone, "val-phone-" + type, valueCode);
                        const country_code = JSON.parse(localStorage.getItem("language"))["phone_code"];

                        let result = true;
                        if (!appId) {
                            document.getElementById("val-support-content-mobile-" + type).setAttribute('style', 'display: block');
                            result = false;
                        } else {
                            document.getElementById("val-support-content-mobile-" + type).setAttribute('style', 'display: none');
                        }
                        if (!resultName || !resultEmail || !resultPhone || !result) {
                            return false
                        }
                        document.getElementById("icon-loading-" + type).setAttribute('style', 'display: inline-block');
                        document.getElementById("button-registration-" + type).setAttribute('disabled', 'true');
                        document.getElementById("icon-loading-mobile-" + type).setAttribute('style', 'display: inline-block');
                        document.getElementById("button-registration-mobile-" + type).setAttribute('disabled', 'true');


                        let fullDomain = document.URL;
                        let domain = fullDomain.split("/");
                        var url_current = domain[0] + "//" + domain[2] + "/order-register-custom";

                        const options = {
                            method: 'POST',
                            headers: {
                                "Content-Type": "application/json"
                            },
                            body: JSON.stringify({
                                phone: phone,
                                email: email,
                                name: name,
                                country_code: country_code,
                                p: appId,
                                product_id: listProduct[appId],
                            })
                        };

                        var aPromise = fetch(url_current, options);
                        aPromise
                            .then(response => response.json())
                            .then(data => {
                                document.getElementById("icon-loading-" + type).setAttribute('style', 'display: none');
                                document.getElementById("button-registration-" + type).removeAttribute('disabled');
                                document.getElementById("icon-loading-mobile-" + type).setAttribute('style', 'display: none');
                                document.getElementById("button-registration-mobile-" + type).removeAttribute('disabled');

                                if (data['code'] == 200) {
                                    if (type == 1) {
                                        ga('send', {
                                            'hitType': 'event',
                                            'eventCategory': 'homemk_orderbox1',
                                            'eventAction': 'Click',
                                            'eventLabel': 'form đăng ký '
                                        });
                                    } else {
                                        ga('send', {
                                            'hitType': 'event',
                                            'eventCategory': 'homemk_orderbox2',
                                            'eventAction': 'Click',
                                            'eventLabel': 'form dang ky 2 '
                                        });
                                    }

                                    $('#popup').modal('toggle');
                                    $('#sign_up_for_advice_name_' + type).val('');
                                    $('#sign_up_for_advice_phone_' + type).val('');
                                    $('#sign_up_for_advice_email_' + type).val('');
                                } else {
                                    $('#support-content').val('').attr('key', '');
                                    removeClassByClassName('content-item-2', 'active');
                                    $('#popup-error').modal('toggle');
                                }
                            })
                            .catch(error => {
                                document.getElementById("icon-loading-" + type).setAttribute('style', 'display: none');
                                document.getElementById("button-registration-" + type).removeAttribute('disabled');
                                document.getElementById("icon-loading-mobile-" + type).setAttribute('style', 'display: none');
                                document.getElementById("button-registration-mobile-" + type).removeAttribute('disabled');
                                $('#popup-error').modal('toggle')
                            });
                    }
                </script>
